// import ConfidenceThresholdSlider from '../../CommonComponents/Slider/ConfidenceThresholdSlider'
import { Box, Slider } from '@mui/material'

class VideoPlayer extends Component {
    constructor(props) {
        super(props)
        this.state = {
            videoUrl: 'https://www.youtube.com/watch?v=HAj_d6dR_xM',
        }
    }

    render() {
        return (
            <Box>
                {/*  Video Player  */}
                <video
                    src={this.state.videoUrl}
                    controls={true}
                    autoPlay
                    muted
                />
                {/*<source src={this.state.videoUrl} type="video/mp4" />*/}
                {/*</video>*/}
            </Box>
        )
    }
}

export default VideoPlayer
